import * as api from '../api/auth.js';

export const register = (newUser, history) => async (dispatch) => {
  try {
    const { data } = await api.register(genreName);
    history.push('/');
    console.log(data);
    dispatch({ type: 'REGISTER', payload: data });
  } catch (error) {
    console.log(error.message);
  }
};
